import SwiftUI

struct MatchCardView: View {
    //var viewModel: MatchCardViewViewModel
    private let participant: ParticipantDto
    private let puuid: String
    //@State var match: MatchDto?
    private let match: MatchDto
    //@State private var isNavigationActive = false // State variable to control navigation

    //init(puuid: String, matchId: String) {
   //     self.puuid = puuid
   //     self.viewModel = MatchCardViewViewModel(matchId: matchId)
   //  }
    private let champion: Champion
    init(puuid: String, match: MatchDto) {
        self.puuid = puuid
        self.match = match
        self.participant = match.info.participants.first(where: {$0.puuid == puuid})!
        self.champion = ChampionModel.shared.getChampionFromId(id: String(participant.championId))!
        
    }
    var body: some View {

            ZStack {
              
                        RoundedRectangle(cornerRadius: 30)
                            .foregroundColor(Color(uiColor: .secondarySystemBackground))
                        VStack {
                            HStack {
                                Text(match.info.gameMode)
                                    .padding()
                                    .bold()
                                Spacer()
                                ZStack {
                                    RoundedRectangle(cornerRadius: 50)
                                        .foregroundColor(participant.win ? .blue:.red)
                                        .frame(width: 100, height: 40)
                                        .padding()
                                    Text(participant.win ? "Victory":"Defeat")
                                        .bold()
                                }
                            }
                            HStack {
                                ZStack {
                                  
                                    ChampionSplashView(championId: champion.id)
                                    
                                }
                               
                                VStack {
                                    HStack {
                                        ItemView(itemId: participant.item0)
                                            .frame(width: 30)
                                        ItemView(itemId: participant.item1)
                                            .frame(width: 30)
                                        ItemView(itemId: participant.item2)
                                            .frame(width: 30)
                                    }
                                    HStack {
                                        ItemView(itemId: participant.item3)
                                            .frame(width: 30)
                                        ItemView(itemId: participant.item4)
                                            .frame(width: 30)
                                        ItemView(itemId: participant.item5)
                                            .frame(width: 30)
                                    }
                                    .padding(10)
                                    HStack {
                                        if let summoner1 = SummonerModel.shared.getSummonerFromKey(key: String(participant.summoner1Id)) {
                                            AsyncImage(url: URL(string: "https://ddragon.leagueoflegends.com/cdn/14.2.1/img/spell/\(summoner1.id).png"), content: { image in
                                                    image
                                                        .resizable()
                                                        .scaledToFit()
                                                        .aspectRatio(contentMode: .fit)
                                                        .clipShape(.circle)
                                                        .frame(width: 25)
                                                })
                                                {
                                                    EmptyView()
                                                }
                                           
                                        }
                                        if let summoner2 = SummonerModel.shared.getSummonerFromKey(key: String(participant.summoner2Id)) {
                                            AsyncImage(url: URL(string: "https://ddragon.leagueoflegends.com/cdn/14.2.1/img/spell/\(summoner2.id).png"), content: { image in
                                                    image
                                                        .resizable()
                                                        .scaledToFit()
                                                        .aspectRatio(contentMode: .fit)
                                                        .clipShape(.circle)
                                                        .frame(width: 25)
                                                })
                                                {
                                                    EmptyView()
                                                }
                                        }
                                        
                                    }
                                }
                                .padding(.trailing)
                                
                            }
                            
                            HStack {
                                Text(String(participant.champLevel))
                                    .bold()
                                    .font(.title3)
                                    .padding()
                                Text(participant.championName)
                                    .bold()
                                    .font(.title3)
                                   
                                Spacer()
                            }
                            HStack(alignment: .top) {
                                Spacer()
                                Image("score")
                                Text("\(participant.kills)/\(participant.deaths)/\(participant.assists)")
                                    .bold()
                                Spacer()
                                Image("minion")
                                Text("\(participant.totalMinionsKilled)")
                                    .bold()
                                Spacer()
                                Image("items")
                                Text("\(participant.goldEarned)")
                                    .bold()
                                Spacer()
                            }
                        }
                   // }
                }
   
        .padding()
 
        
        
       
    }
        
}

